import './Header.css';
import { BsList } from 'react-icons/bs';

const Header = () => {
  return (
    <>
      <header className='container header'>
        <ul>
          <li><BsList style={{
            cursor:'pointet'
          }} /></li>
          <li><img src={require('../../images/profile/kurumi-avatar.png')} alt="" /></li>
        </ul>
      </header>
    </>
  )
}

export default Header;
